import React from "react";
import styled from "styled-components";
import data from "../data/fearless.json";


const Li = styled.li`{
  list-style: none;
};`

const Button = styled.button`
  display:flex;
  gap: 10px;
  flex-direction: column;
  border: none;
  background-color: #f6ed95;
  color: black;
  padding: 10px;
  border-radius: 2px;
  cursor: pointer;

`;

export default function Tracks() {
  return (
    <div>
      <h1>{data.title}</h1>
      <ul>
        {data.tracks.map((track) => (
          <Button><Li key={track.id}>{track.number} - {track.title}</Li></Button>
        ))}
      </ul>
    </div>
  );
}
